import React, { useEffect, useState } from "react";
import axios from "axios";
import {
  //   chit_get_url,
  //   chitdue_get_url,
  //   chitdue_add_url,
  //   chitdue_amount_update_url,
  dueamountunwind_url,
} from "./url/url";

const Chit = () => {
  const [chitduememberlist, setChitduememberlist] = useState([]);

  useEffect(() => {
    getchitduememberlist();
  }, []);

  const getchitduememberlist = async () => {
    try {
      const response = await axios.get(dueamountunwind_url);
      setChitduememberlist(response.data);
    } catch (error) {
      console.error("Error fetching chit master list:", error);
    }
  };

  return (
    <div>
      <h5>Due List</h5>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Amount Due</th>
            {/* Add more table headers as needed */}
          </tr>
        </thead>
        <tbody>
          {chitduememberlist.map((member, index) => (
            <tr key={index}>
              <td>{member.name}</td>
              <td>{member.amountDue}</td>
              {/* Render more table cells for additional member properties */}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Chit;
